import React from 'react'
import './index.css'

export default function index({ jokes }) {
    return (
        <div className="tableContainer">
            <ul>
                {jokes?.map((elm, index) =>
                    <li key={index}>{elm.value}</li>
                )}
            </ul>
        </div>
    )
}
